css:
@namespace url(http://www.w3.org/1999/xhtml);
@namespace url(http://www.w3.org/1999/xhtml);

@-moz-document domain('faculty.online.fullsail.edu') {

	/* Resets */
	html, body { width: 100%; height: 100%; background-color: #dcdee0; background-image: url(data:image/gif;base64,);  }
	#headerLeft { position: relative !important; }
	.ml20, .ml10, .mr10, .mb10, .mt10 { margin: 0 !important;}

	/* Hide stuff */
	#headerWrapper h3 { display: none; }

	/* Structure */ 
	#content { background-color: #fff; padding: 20px !important; position: absolute !important; left: 210px; top: 85px; min-height: 100%; border-radius: 5px 5px 0px 0px; box-shadow: 0px 0px 5px rgba(0, 0, 0, .15); }
	#footer { display: none; }
	#headerWrapper { background-color: #2a2a2a; margin: 0; padding: 0px !important; background: url(data:image/png;base64,) 30px 0; height: 110px !important; }
	#importantAnnouncementList,
	#announcementList,
	#importantAnnouncementListTitle,
	#announcementListTitle { width: 900px !important; }


	/* Global Font Styles */
	h1 { font-size: 15px !important; font-weight: normal !important; }
	h2 { font-size: 13px !important; font-weight: normal !important; }
	h3 { font-size: 11px !important; font-weight: normal !important; }
	.published { color: #5f9f57 !important; }

	/* Header */
	#topLinks { width: 250px !important; margin: 20px 0 0 0 !important; width: 100px; position: absolute; right: -253px; text-align: right; font-size: 10px; color: #999; }
	#topLinks a { color: #ef4723 !important; }
	#topLinks a b { font-weight: normal; }
	#headerLeft { padding: 10px 0 0 210px !important; width: 530px !important; }
	#headerLeft select { margin: 0 10px 0 0; }

	/* Main Nav */
	#mainNav, #secondaryNav { display: block !important; position: absolute !important; top: 130px !important; left: 20px !important; z-index: 2; }
	#secondaryNav { top: 330px !important; left: -740px !important; margin: 0 !important; }
	#mainNav li, 
	#secondaryNav li { width: 190px !important; height: 50px !important; display: block !important; margin: 0px !important; padding: 0px !important; }
	#mainNav li a.tab1, #secondaryNav li a { }
	#mainNav li a:hover, #secondaryNav li a:hover { color: #000; }
	#headerWrapper a.tab1, 
	#headerWrapper a.tab2 { float: none !important; cursor: pointer; width: 100%; height: 100%; display: block; line-height: 50px !important; text-align: left; text-indent: 55px; font-size: 15px !important; color: #999 !important; background: none; background: none !important; color: #999; margin: 0px !important; padding: 0px !important; }
	#headerWrapper a.active { border-radius: 5px 0px 0px 5px; box-shadow: -4px 2px 5px rgba(0, 0, 0, .15); }
	a.active:hover { color: #999; }
	#mainNav li:nth-of-type(1) a        { background: url(data:image/png;base64,) 15px 16px no-repeat !important;   }
	#mainNav li:nth-of-type(2) a        { background: url(data:image/png;base64,) 15px -44px no-repeat !important;  }
	#mainNav li:nth-of-type(3) a        { background: url(data:image/png;base64,) 15px -101px no-repeat !important; }
	#mainNav li:nth-of-type(4) a        { background: url(data:image/png;base64,) 15px -161px no-repeat !important; }
	#secondaryNav li:nth-of-type(1) a   { background: url(data:image/png;base64,) 15px -220px no-repeat !important; }
	#secondaryNav li:nth-of-type(2) a   { background: url(data:image/png;base64,) 15px -283px no-repeat !important; }
	#secondaryNav li:nth-of-type(3) a   { background: url(data:image/png;base64,) 15px 16px no-repeat !important;   }
	#mainNav li:nth-of-type(1) a.active,
	#mainNav li:nth-of-type(2) a.active,
	#mainNav li:nth-of-type(3) a.active,
	#mainNav li:nth-of-type(4) a.active,
	#secondaryNav li:nth-of-type(1) a.active,
	#secondaryNav li:nth-of-type(2) a.active,
	#secondaryNav li:nth-of-type(3) a.active { background-color: #fff !important; }
	#mainNav li a:hover, 
	#secondaryNav li a:hover { border-radius: 5px 0px 0px 5px; background-color: rgba(255, 255, 255, .3) !important; color: #666 !important; }


	/* Right Column */
	#rightCol,
	#rightCol.col220 { background: none !important; border: none !important; }
	.titleBar { margin: 0 0 10px 0 !important; padding: 0 0 10px 0 !important; border-bottom: double 3px #DDD !important; }
	#rightCol form p { margin: 5px 0; }
	#rightCol form p:last-child { margin: 5px 0 20px 0;}
	.pb0 { margin-bottom: 10px !important; }

	/* Student List */
	.studentList .student { }
	.studentList .icons { top: 4px; }
	.student .studentName { display: block; width: 100%; margin: 0px !important; padding: 7px 0px !important; cursor: default; border-bottom: 1px solid #eee; text-indent: 90px; }
	.student .studentName em { color: #999; }
	.studentList .student .studentName { width: 100% !important; background-color: #fff !important; overflow: hidden; }
	.studentList .student:hover .studentName,
	.activity:hover .activityRight,
	#importantAnnouncementList li:hover,
	#announcementList li:hover,
	#sortable li:hover { background: #f7f7f7 !important; background-image: none !important; }

	/* Exceptions */ 
	.activity .activityRight { width: 100% !important; margin: 0px !important; text-indent: 10px; padding: 7px 0px !important; cursor: default; border-bottom: 1px solid #eee; }


	/* Announcements */
	.activityType,
	#assignments .activity  { margin: 0 0 20px 0 !important; }
	#importantAnnouncementList li,
	#announcementList li { padding: 4px 0 !important; }
	#importantAnnouncementListTitle .buttonsCol,
	#announcementListTitle .buttonsCol { width: 85px !important; }
	.buttonsWrapper { width: auto !important; }


	/* Icons */ 
	.icons.left { width: 85px !important; top: 6px !important; margin: 0px !important; }
	.buttonsCol { width: 85px !important; }
	
	.icons.left a,
	.buttonsCol a { background-position: center !important; border-radius: 25px; padding: 2px !important; background-color: #CCC !important; margin-left: 3px !important; background-repeat: no-repeat; }
	
	.icons.left a:hover,
	.buttonsCol a:hover { background-color: #ef4723 !important; }

	.downloadIcon { background-image: url(data:image/png;base64,) !important; }
	.gradeIcon { background-image: url(data:image/png;base64,) !important; }
	.resubmitIcon { background-image: url(data:image/png;base64,) !important; }
	.buttonsCol .edit { background-image: url(data:image/png;base64,) !important; }
	.buttonsCol .delete { background-image: url(data:image/png;base64,) !important; }
	.buttonsCol .move { background-image: url(data:image/png;base64,) !important; }
	
	#importantAnnouncementList li span,
	#announcementList li span { overflow: visible !important; }


	/* Discussions list */
	#discussionsList { list-style-type: none; }
	#discussionsList li { line-height: 25px !important; }

	/* Setup tab */
	#sortable { width: 900px !important; }
	#sortable li { padding: 5px 0 !important; }
	#sortable li span { overflow: visible !important; }


	/* Give the content some breathing room on larger screens */
	@media only screen and (min-width: 1500px) {
	  #content.col980 { width: 1200px !important; }
	  #topLinks { right: -472px !important; }
	  #leftCol.col740 { width: 900px !important; }
	}


}
